import os
import json
import pathlib

########### END OF IMPORTS ##############

script_directory = pathlib.Path().absolute()

def parse_result(one_player_record:list):

    ### create new list for 0s & 1s & 999s
    game_results = []
    for game_result in one_player_record:
        if game_result == '승리':
            game_results.append(1)
        elif game_result == 'WIN':
            game_results.append(1)
        elif game_result == '패배':
            game_results.append(0)
        elif game_result == 'LOSE':
            game_results.append(0)
        elif game_result == '다시하기':
            game_results.append(999)
        elif game_result == 'REMAKE':
            game_results.append(999)

    ### remove remakes
    for res in game_results:
        if res == 999:
            game_results.remove(res)

    return game_results


def write_player_record(filepath, player, parsed_game_results):
    elo = filepath.split('/')[-2]
    filename = filepath.split('/')[-1].split('.')[0]
    saved_filepath = f'{script_directory}/soloq_scrape/scraped_results/parsed_200plus/{elo}/{filename}/{player}.txt'

    with open(saved_filepath, 'w') as file:
        file.write(str(parsed_game_results))

    return saved_filepath






